import React from "react";


const NavItem = ({ nav_img, nav_num }) => {


    const btnClick = (num) => {
        console.log(num)
    }

    return (
        <TouchEvent onClick={btnClick(nav_num)}>
            <div id={"nav_item" + nav_num} className="nav_item">
                <div className="nav_item_img">
                    <img className="btn_img" draggable="false" src={nav_img} alt="" />
                </div>
                <p> ИСТОРИЯ </p>
            </div>
        </TouchEvent>
    )
}

export default NavItem;
